("23","Loan","created","App\\Models\\Loan","created","4","App\\Models\\User","1","{\"attributes\":{\"id\":4,\"uuid\":\"96bc88ae-f5f4-4e92-b8e8-f1cca463b11a\",\"loan_number\":\"#LOAN33312\",\"user_id\":3,\"loan_type_id\":4,\"loan_amount\":10000,\"percentage\":15,\"total_amount\":8500,\"document_charge\":null,\"loan_start_date\":\"2024-02-09\",\"period_unit\":\"day\",\"period_time\":\"100\",\"emi_date\":null,\"loan_end_date\":null,\"is_active\":\"1\",\"loan_status\":\"active\",\"loan_note\":\"under section 19, the inspecting officer is satisfied that the Money-Lender is in possession of property\' pledged to him by a debtor as security for the loan advanced by the Money-Lender without a valid registration, the inspecting officer shall require the Money-Lender to deliver forthwith the possession of such property to him.\\r\\n(2) Upon the property being delivered to him, the inspecting officer, if he is not the Registrar, shall entrust it to the Registrar and the Registrar (when he is also the inspecting officer) shall keep it in his custody for being disposed of as hereinafter provided.\\r\\n(3) On delivery of the property under sub-section (1) or sub-section (2), the Registrar shall, after due verification and identity thereof, return it to the debtor who has pledged it or, where the debtor is dead, to his legal heir.\\r\\n(4) If the debtor or his legal heir cannot be traced, the Registrar shall, within ninety days from the date of taking possession of the property, publish notice in the prescribed manner inviting claims thereto. If a claim is received, whether in answer to the notice or otherwise, he shall adjudicate upon and decide such claim. If the Registrar is satisfied that any claim is valid, he shall deliver the possession of the property to the person claiming it on his giving a receipt thereof; and such delivery of the property to the person claiming it shall discharge the Registrar of his liability in respect of such property\' against any other person. If the claim is refused, the property shall stand forfeited to the State Government.\\r\\n(5) Where the possession of the property pledged by a debtor can not for any reason (including identity\' thereof) be delivered to him, then the Money-Lender to whom it was pledged shall be required to pay to the debtor or if he is dead, to his legal heir, the value of such property if such debtor or, as the case may be, the heir claims the property. If the Money-Lender fails to pay the value, it may be recoverable from him as an arrears of land revenue and on recovery of the value, it shall be delivered to the debtor by whom such property was pledged or, as the case may be, to the legal heir and if the debtor or his legal heir can not be traced, the provisions of sub-section (4) apply.\\r\\n(6) If there is any difference of opinion between the Money-Lender and the debtor, or as the case may be, his legal heir, on the question of value of the property or its identity, the question shall be referred to the Registrar General for decision and his decision shall be final.\\r\\n(7) The value of the property may be determined with the assistance of the services of an expert appointed by the Registrar General in that behalf. The expert may be paid such honoraria as the Registrar General may, by an order in writing from time to time in relation to any area or areas, determine.\",\"created_by\":1,\"deleted_at\":null,\"created_at\":\"2024-02-09T10:57:51.000000Z\",\"updated_at\":\"2024-02-09T10:57:51.000000Z\"}}","","2024-02-09 10:57:51","2024-02-09 10:57:51"),
